function countup(e,t,n){var a=0;const r=setInterval(()=>{a!=e?(a+=1,document.getElementsByClassName("count-up")[t].innerHTML=a):clearInterval(r)},n)}const variables=document.getElementsByClassName("count-up");for(let e=0;e<variables.length;e++){var number=variables[e].innerHTML,speed=(variables[e].getAttribute("data-speed")||100)/number*100;countup(number,e,speed)}